// src/components/ViewersList.js
import React from 'react';
import '../../CSS/ViewersList.css'; // Import your CSS file

const ViewersList = ({ viewers, onBack }) => (
  <div className="viewers-list"> {/* Apply the viewers-list class here */}
    <h2>Viewers List</h2>
    {viewers.length === 0 ? (
      <p>No viewers found.</p>
    ) : (
      <ul>
        {viewers.map((viewer) => (
          <li key={viewer.id}>
            {viewer.firstName} {viewer.lastName} (ID: {viewer.id})
          </li>
        ))}
      </ul>
    )}
    <button onClick={onBack}>Back to Admin Options</button>
  </div>
);

export default ViewersList;
